import React from "react";
import { connect } from "react-redux";
import { fetchCampusThunk, updateCampusThunk } from "../../store/thunks";
import EditCampusView from "../views/EditCampusView";
import Header from "../views/Header"; // Import the Header component

const EditCampusContainer = (props) => {
  return (
    <div>
      <Header /> {/* Include the Header component */}
      <EditCampusView
        fetchCampus={props.fetchCampus}
        updateCampus={props.updateCampus}
        campus={props.campus}
      />
    </div>
  );
};

const mapState = (state) => {
  return {
    campus: state.campus,
  };
};

const mapDispatch = (dispatch) => ({
  fetchCampus: (id) => dispatch(fetchCampusThunk(id)),
  updateCampus: (id, campus) => dispatch(updateCampusThunk(id, campus)),
});

export default connect(mapState, mapDispatch)(EditCampusContainer);
